import './App.scss';
import { Card } from './components/card';

function App() {
  let response = fetch(`https://rickandmortyapi.com/api/character/1`);
  let data = response.json()
  console.log(data.name);
  return (
    <>
      <h1>Rick and Morty</h1>
      <div className='container'>

          <Card
            name={data.name}
            iamge={data.image}
            gender={data.gender}
            key={data.id}
          />


      </div>
    </>
  );
}

export default App;
